    }
    let glow = (moveMode && !data.spots[name].plane ? "glow" : "");
    let heightVal = "68px";
    if (spotType === "half") {
        heightVal = "34px";
    }
    return (
        <td id={name} className={glow} width="75px" height={heightVal}
                onClick={() => moveHere(name, data, updateData, moveMode, setMoveMode)}>
            <div>{plane}</div>
        </td>
    );
