function PlaneBox({ moveMode, setMoveMode }) {
    const [planes, setPlanes] = useState(null);
    useEffect(() => {
        async function getPlanes() {
            const response = await fetch("http://localhost:8080/getSpot?spot=planeBox");
            return response.json();
        }
        getPlanes().then(planes => setPlanes(planes.plane)).catch(e => console.log(e));
    }, []);

    if (planes) {
        const planeElements = [];
        planes.forEach((plane) => {
            planeElements.push(
                <Plane plane={plane} moveMode={moveMode} setMoveMode={setMoveMode} />
            );
        });
        return (
            <div>
                {planeElements}
            </div>
        );
    }
}

function Plane({ plane }) {

    const planeToMove = useContext(planeToMoveContext);

    let planeClass = "plane " + plane.type;
    if (planeToMove.plane === plane.tailNumber) {
        planeClass += " glow";
    }
    return (
        <span id={plane.tailNumber} className={planeClass}
                onClick={() => { planeToMove.setPlaneToMove(plane.tailNumber) }}>
            {plane.tailNumber}
        </span>
    );

}

export default function App() {

    // state
    const [data, updateData] = useState(origData);
    const [moveMode, setMoveMode] = useState(null);


    useEffect(() => {
        let mount = true;
        let events;
        let timer;
        let createEvents = () => {
            if(events){
                events.close();
            }
            events = new EventSource(`http://localhost:8080/events`);
            events.onmessage = (event) => {
                if(mount){

                    // process data between here

                    let parsedData = JSON.parse(event.data);

                    //setTasks(parsedData);

                    // and here

                }
            };
            events.onerror = (err) => {
                timer = setTimeout(() => {
                    createEvents();
                }, 1000);
            };
        };
        createEvents();
        return () => {
            mount = false;
            clearTimeout(timer);
            events.close();
        }
    }, []);


    // function to move plane
    async function moveHere(spotName, moveMode, setMoveMode) {
        if (moveMode) {

            /*
            let planeData;
            data.planes.forEach((plane) => {
                if (plane.tailNumber === moveMode) {
                    planeData = plane;
                }
            });
            if (Array.isArray(data.spots[planeData.spot].plane)) {
                data.spots[planeData.spot].plane.splice(
                    data.spots[planeData.spot].plane.indexOf(planeData), 1);
            } else {
                data.spots[planeData.spot].plane = null;
            }
            planeData.spot = spotName;
            if (Array.isArray(data.spots[spotName].plane)) {
                data.spots[spotName].plane.push(planeData);
            } else {
                data.spots[spotName].plane = planeData;
            }
            updateData(data);
            */

            //console.log("test" + moveMode);
            await fetch(
                "http://localhost:8080/movePlane?plane=" + moveMode + "&spot=" + spotName);

            setMoveMode(null);
        }
    }

    return (
        <div>
            <div id="frame">
                <div id="title" className="box title-box">
                    <h1>Aircraft Locations</h1>
                </div>
                <RampBox
                    moveMode={moveMode}
                    setMoveMode={setMoveMode}
                    moveHere={moveHere}
                />
                <DirectionBox
                    data={data}
                    updateData={updateData}
                    moveMode={moveMode}
                    setMoveMode={setMoveMode}
                    moveHere={moveHere}
                />
                <HangarsBox
                    data={data}
                    updateData={updateData}
                    moveMode={moveMode}
                    setMoveMode={setMoveMode}
                    moveHere={moveHere}
                />
                <OtherBox
                    data={data}
                    updateData={updateData}
                    moveMode={moveMode}
                    setMoveMode={setMoveMode}
                    moveHere={moveHere}
                />
                <TDoorsBox
                    data={data}
                    updateData={updateData}
                    moveMode={moveMode}
                    setMoveMode={setMoveMode}
                    moveHere={moveHere}
                />
            </div>
            <div id="note">
                Made with love by Johnny Burrer :)
                Reach out on GroupMe with any feedback/bug reports!
            </div>
            <PlaneBox
                moveMode={moveMode}
                setMoveMode={setMoveMode}
            /> 
        </div>
    );
}
